(2, '1-550c16d2ee0fc', '25th Anniversary Concert!', '', 'Y', 'Y', '25th-anniversary-concert-1-550c16d2ee0fc', '2015-03-28', '2015-03-28', '2015-03-20', '2015-03-28', '09:00', '12:00', NULL, '202 Jeanette Lancaster Way', '', 'Charlottesville', 'Virginia', '22903', '', 'McLeod Hall', '', '', '', 'https://www.facebook.com/events/598045283629359/', '', '200', 'Y', 10, 'Y', 'Y', 'A', 'Hi!\r\n\r\nThank you for purchasing a ticket to the New Dominions\\&#039; 25th Anniversary Concert, \\&quot;We Could\\&#039;ve Been the Jeffersonics.\\&quot; We appreciate your support and cannot wait to see you on March 28th. Please arrive at McLeod Hall to pick up your ticket 15 minutes before the show starts to collect your ticket at will call. We will have your names, but please bring photo ID so we can ensure that you are receiving the correct ticket. Thanks again, and get excited for a great show!\r\n\r\n&nbsp;\r\n\r\nBest,\r\n\r\nThe New Dominions', '', 'N', NULL, NULL, NULL, NULL, 'N', NULL, NULL, '', '', '', '', '', 'a:1:{i:1;s:1:\"1\";}', NULL, NULL, 'N', 0, 0, 0, '', 'a:5:{s:22:\"default_payment_status\";s:0:\"\";s:8:\"venue_id\";s:0:\"\";s:28:\"additional_attendee_reg_info\";s:0:\"\";s:28:\"add_attendee_question_groups\";s:0:\"\";s:14:\"date_submitted\";s:14:\"March 20, 2015\";}', 1, 0, '', NULL, 0, 0x323031352d30332d32302030383a34373a3134),
(3, '1-5636b41a59d37', '17 Newdos and Counting: Fall 2015 Concert', 'Do you love a cappella music?\r\nDo you love your family and your numerous siblings?\r\nGet ready for New Dominions Fall Concert 2015, \\\"17 Newdos and Counting\\\"!\r\n\r\nWe will be singing songs like, \\\"Hold Back the River\\\" by James Bay, \\\"Stitches\\\" by Shawn Mendes, \\\"Weekend\\\" by VERITE, and many more!\r\n\r\nThe concert will be held next Saturday, November 7th at 8 PM in McLeod Hall.\r\nMake sure that you reserve your ticket at newdominions.com or buy tickets from the Lawn from 10 AM - 3 PM, Monday - Friday. The tickets will be $6 for students on the lawn, and $7 online, at the door, and for non-students!\r\n\r\nWe can\\\'t wait to see you all, and it\\\'s going to be an exciting night!', 'Y', 'Y', '17-newdos-and-counting-fall-2015-concert-1-5636b41a59d37', '2015-11-07', '2015-11-07', '2015-11-01', '2015-11-07', '09:00', '12:00', NULL, '202 Jeanette Lancaster Way', '', 'Charlottesville', 'VA', '22903', '', 'McLeod Hall', '', '', '', 'https://www.facebook.com/events/171549883190097/', '', '200', 'Y', 10, 'Y', 'Y', 'A', '&lt;p&gt;Hi!&lt;/p&gt;\r\n&lt;p&gt;Thank you for purchasing a ticket to the New Dominions\\&#039; Fall 2015 Concert, \\&quot;17 Newdos and Counting.\\&quot; We appreciate your support and cannot wait to see you on November 7th. Please arrive at McLeod Hall to pick up your ticket 15 minutes before the show starts to collect your ticket at will call. We will have your names, but please bring photo ID so we can ensure that you are receiving the correct ticket. Thanks again, and get excited for a great show!&lt;/p&gt;\r\n&lt;p&gt;&lt;/p&gt;\r\n&lt;p&gt;Best,&lt;/p&gt;\r\n&lt;p&gt;The New Dominions&lt;/p&gt;\r\n', 'N', 'N', NULL, NULL, NULL, NULL, 'N', NULL, NULL, '', '', '', '', '', 'a:1:{i:1;s:1:\"1\";}', NULL, NULL, 'N', 0, 0, 0, '', 'a:5:{s:8:\"venue_id\";i:0;s:28:\"additional_attendee_reg_info\";s:1:\"2\";s:28:\"add_attendee_question_groups\";s:0:\"\";s:14:\"date_submitted\";s:19:\"2015-11-01 19:53:46\";s:22:\"default_payment_status\";s:0:\"\";}', 1, 0, '', NULL, 0, 0x323031352d31312d30312031393a35333a3436),
(4, '1-56f0de2d7e11f', 'No Context: Spring 2016 Concert', '<p>Do you love a broccoli? Do you love a cat?<br />\r\nDo you love anything that is just random and out of context?<br />\r\nThen you will love New Dominions Spring Concert 2016, \\\"No Context\\\"!</p>\r\n<p>We will be singing songs like, \\\"Alive\\\" by Sia, \\\"Fix You\\\" by Coldplay, \\\"Desperado\\\" by The Eagles, and many more!</p>\r\n<p>The concert will be held this Saturday, April 2nd at 8 PM in McLeod Hall.<br />\r\nMake sure that you reserve your ticket at newdominions.com or buy tickets from the Lawn from 10 AM - 3 PM, Monday - Friday. The tickets will be $6 for students on the lawn, and $7 online, at the door, and for non-students!</p>\r\n<p>We can\\\'t wait to see you all, and it\\\'s going to be an exciting night!</p>\r\n', 'Y', 'Y', '17-newdos-and-56f0de2d7e15e', '2016-04-02', '2016-04-02', '2016-03-27', '2016-04-02', '09:00', '20:00', NULL, '202 Jeanette Lancaster Way', '', 'Charlottesville', 'VA', '22903', '', 'McLeod Hall', '', '', '', 'https://www.facebook.com/events/171549883190097/', '', '200', 'Y', 10, 'Y', 'Y', 'A', '&lt;p&gt;Hi!&lt;/p&gt;\r\n&lt;p&gt;Thank you for purchasing a ticket to the New Dominions\\&#039; Spring 2016 Concert, \\&quot;No Context.\\&quot; We appreciate your support and cannot wait to see you on April 2nd. Please arrive at McLeod Hall to pick up your ticket 15 minutes before the show starts to collect your ticket at will call. We will have your names, but please bring photo ID so we can ensure that you are receiving the correct ticket. Thanks again, and get excited for a great show!&lt;/p&gt;\r\n&lt;p&gt;&lt;/p&gt;\r\n&lt;p&gt;Best,&lt;/p&gt;\r\n&lt;p&gt;The New Dominions&lt;/p&gt;\r\n', '', 'N', NULL, '', NULL, NULL, 'N', 0, '', '', '', '', '', '', 'a:1:{i:1;s:1:\"1\";}', NULL, NULL, 'N', 0, 0, 0, '', 'a:5:{s:22:\"default_payment_status\";s:0:\"\";s:8:\"venue_id\";s:0:\"\";s:28:\"additional_attendee_reg_info\";s:0:\"\";s:28:\"add_attendee_question_groups\";s:0:\"\";s:14:\"date_submitted\";s:14:\"March 22, 2016\";}', 1, 0, '', NULL, 0, 0x323031362d30332d32322030313a35343a3533),
(5, '1-580e7c527b99a', 'Paranewdo Activity: Fall 2016 Concert', '<p>Are you looking for a great music at a spooky concert for Halloween?<br />\r\nCome out to New Dominions Fall Concert 2016, \\\"Paranewdo Concert\\\"!</p>\r\n<p>We will be singing songs like, \\\"Reaper\\\" by Sia, \\\"Into you\\\" by Ariana Grande, \\\"I took a pill from Ibiza\\\" by Mike Posner, and many more!</p>\r\n<p>The concert will be held this Saturday, October 29th at 7 PM in McLeod Hall.<br />\r\nMake sure that you reserve your ticket at newdominions.com or buy tickets from the Lawn from 10 AM - 3 PM, Monday - Friday. The tickets will be $6 for students on the lawn, and $7 online, at the door, and for non-students!</p>\r\n<p>We can\\\'t wait to see you all, and it\\\'s going to be an exciting night!</p>', 'Y', 'Y', 'paranewdo-activity-fall-2016-concert-1-580e7c527b99a', '2016-10-29', '2016-10-29', '2016-10-24', '2016-10-29', '09:00', '19:00', NULL, '202 Jeanette Lancaster Way', '', 'Charlottesville', 'VA', '22903', '', 'McLeod Hall', '', '', '', 'https://www.facebook.com/events/728961157251852/', '', '200', 'Y', 10, 'Y', 'Y', 'A', '&lt;p&gt;Hi!&lt;/p&gt;\r\n&lt;p&gt;Thank you for purchasing a ticket to the New Dominions\\&#039; Fall 2016 Concert, \\&quot;Paranewdo Activity.\\&quot; We appreciate your support and cannot wait to see you on October 29th. Please arrive at McLeod Hall to pick up your ticket 15 minutes before the show starts to collect your ticket at will call. We will have your names, but please bring photo ID so we can ensure that you are receiving the correct ticket. Thanks again, and get excited for a great show!&lt;/p&gt;\r\n&lt;p&gt;&lt;/p&gt;\r\n&lt;p&gt;Best,&lt;/p&gt;\r\n&lt;p&gt;The New Dominions&lt;/p&gt;\r\n', 'N', 'N', NULL, NULL, NULL, NULL, 'N', NULL, NULL, '', '', '', '', '', 'a:1:{i:1;s:1:\"1\";}', NULL, NULL, 'N', 0, 0, 0, '', 'a:5:{s:8:\"venue_id\";i:0;s:28:\"additional_attendee_reg_info\";s:1:\"2\";s:28:\"add_attendee_question_groups\";s:0:\"\";s:14:\"date_submitted\";s:19:\"2016-10-24 17:25:38\";s:22:\"default_payment_status\";s:0:\"\";}', 1, 0, '', NULL, 0, 0x323031362d31302d32342031373a32353a3338),
(6, '1-58d15be0726fc', 'It\\\'s Always Sunny at UVA: Spring Concert 2017', '<p>The New Dominions Present: It\\\'s Always Sunny at UVA \\\"The Gang Does A Cappella\\\"</p>\r\n<p>The New Dominions\\\' Spring Concert is this Saturday March 25th at 8pm in McLeod Hall!</p>\r\n<p>Come hear UVA\\\'s Oldest Co-Ed A Cappella Group perform songs by Mike Posner, One Republic, Calvin Harris, Kodaline, The Misterwives, and so much more!</p>\r\n<p>Tickets can be purchased on the South Lawn from Monday - Friday 10am - 3pm or from a Newdo! Tickets are $7 for students and $10 for the public! We can\\\'t wait to see everyone there!</p>\r\n', 'Y', 'Y', 'its-always-sunny-at-uva-spring-concert-2017-1-58d15be0726fc', '2017-03-25', '2017-03-25', '2017-03-20', '2017-03-25', '00:01', '20:00', NULL, '202 Jeanette Lancaster Way', '', 'Charlottesville', 'VA', '22903', '', '', '', '', '', 'https://www.facebook.com/events/1377997988930167/?notif_t=plan_user_associatedif_id=1490110748499059', '', '200', 'Y', 10, 'N', 'Y', 'A', '&lt;p&gt;Hi!&lt;/p&gt;\r\n&lt;p&gt;Thank you for purchasing a ticket to the New Dominions\\&#039; Spring 2017 Concert, \\&quot;It\\&#039;s Always Sunny at UVA.\\&quot; We appreciate your support and cannot wait to see you on March 25th. Please arrive at McLeod Hall to pick up your ticket 15 minutes before the show starts to collect your ticket at will call. We will have your names, but please bring photo ID so we can ensure that you are receiving the correct ticket. Thanks again, and get excited for a great show!&lt;/p&gt;\r\n&lt;p&gt;&lt;/p&gt;\r\n&lt;p&gt;Best,&lt;/p&gt;\r\n&lt;p&gt;The New Dominions&lt;/p&gt;\r\n', '', 'N', NULL, NULL, NULL, NULL, 'N', NULL, NULL, '', '', '', '', '', 'a:1:{i:1;s:1:\"1\";}', NULL, NULL, 'N', 0, NULL, 0, '', 'a:5:{s:22:\"default_payment_status\";s:0:\"\";s:8:\"venue_id\";s:0:\"\";s:28:\"additional_attendee_reg_info\";s:0:\"\";s:28:\"add_attendee_question_groups\";s:0:\"\";s:14:\"date_submitted\";s:14:\"March 21, 2017\";}', 1, 0, '', NULL,