(621, 'spiffy_calendar_options', 'a:10:{s:14:\"calendar_style\";s:3888:\"/* Default styles for Spiffy Calendar */\r\n\r\n.calnk {\r\n	padding-bottom: 5px;\r\n}\r\n.calnk a:hover {\r\n	background-position:0 0;\r\n	text-decoration:none;		\r\n	color:#000000;\r\n	border-bottom:1px dotted #ccc;\r\n}\r\n.calnk a:visited {\r\n	text-decoration:none;\r\n	color:#000000;\r\n	border-bottom:1px dotted #ccc;\r\n}\r\n.calnk a {\r\n	text-decoration:none; \r\n	color:#000000; \r\n	border-bottom:1px dotted #ccc;\r\n}\r\n.calnk a div { \r\n	display:none; \r\n	margin-left:10px;\r\n}\r\n.calnk a:hover div {\r\n	color:#333333; \r\n	background:#F6F79B; \r\n	display:block;\r\n	/*position:absolute; */\r\n	margin-top:1px; \r\n	padding:5px; \r\n	width:150px; \r\n	z-index:100;\r\n	line-height:1.2em;\r\n	box-shadow:2px 2px 2px #c0c0c0;\r\n}\r\n.calnk a:hover div.spiffy-popup {\r\n	position:absolute;\r\n}\r\n.calnk a:hover div div {\r\n	box-shadow:none;\r\n}\r\n.calnk-icon {\r\n	max-width: 76px;\r\n	display: block;\r\n	padding: 0;\r\n	margin-top: 3px;\r\n}\r\n.calnk div img {\r\n	max-width: 140px;\r\n	display: block;\r\n	padding: 0;\r\n	margin: 3px auto;\r\n}\r\n\r\n.calendar-table {\r\n	border:0 !important;\r\n	width:100% !important;\r\n	border-collapse:separate !important;\r\n	border-spacing:2px !important;\r\n}\r\n.calendar-table .calnk-icon {\r\n	margin: 0 auto;\r\n}\r\n.calendar-heading {\r\n	height:25px;\r\n	text-align:center;\r\n	border:1px solid #D6DED5;\r\n	background-color:#E4EBE3;\r\n}\r\n.calendar-next, .calendar-prev {\r\n	width:25%;\r\n	text-align:center;\r\n	font-size:.9em;\r\n}\r\n.calendar-next a, .calendar-prev a {\r\n	text-decoration:none;\r\n}\r\n.calendar-month {\r\n	width:50%;\r\n	text-align:center;\r\n	font-weight:bold;\r\n}\r\n.normal-day-heading {\r\n	text-align:center;\r\n	width:25px;\r\n	height:25px;\r\n	font-size:0.8em;\r\n	border:1px solid #DFE6DE;\r\n	background-color:#EBF2EA;\r\n}\r\n.weekend-heading {\r\n	text-align:center;\r\n	width:25px;\r\n	height:25px;\r\n	font-size:0.8em;\r\n	border:1px solid #DFE6DE;\r\n	background-color:#EBF2EA;\r\n	color:#FF0000;\r\n}\r\n.day-with-date {\r\n	vertical-align:text-top;\r\n	text-align:left;\r\n	width:60px;\r\n	height:60px;\r\n	border:1px solid #DFE6DE;\r\n}\r\n.no-events {\r\n}\r\n.day-without-date {\r\n	width:60px;\r\n	height:60px;\r\n	border:1px solid #E9F0E8;\r\n}\r\ndiv.weekend {\r\n	color:#FF0000;\r\n}\r\n.current-day {\r\n	vertical-align:text-top;\r\n	text-align:left;\r\n	width:60px;\r\n	height:60px;\r\n	border:1px solid #BFBFBF;\r\n	background-color:#E4EBE3;\r\n}\r\ndiv.event {\r\n	font-size:0.75em;\r\n}\r\n.kjo-link {\r\n	font-size:0.75em;\r\n	text-align:center;\r\n}\r\n.calendar-date-switcher {\r\n	height:25px;\r\n	text-align:center;\r\n	border:1px solid #D6DED5;\r\n	background-color:#E4EBE3;\r\n}\r\n.calendar-date-switcher form {\r\n	margin:2px;\r\n}\r\n.calendar-date-switcher input {\r\n	border:1px #D6DED5 solid;\r\n	margin:0;\r\n}\r\n.calendar-date-switcher select {\r\n	border:1px #D6DED5 solid;\r\n	margin:0;\r\n}\r\n.calnk a:hover div div.event-title {\r\n	padding:0;\r\n	text-align:center;\r\n	font-weight:bold;\r\n	font-size:1.2em;\r\n	margin-left:0px;\r\n}\r\n.calnk a:hover div div.event-title-break {\r\n	width:96%;\r\n	text-align:center;\r\n	height:1px;\r\n	margin-top:5px;\r\n	margin-right:2%;\r\n	padding:0;\r\n	background-color:#000000;\r\n	margin-left:0px;\r\n}\r\n.calnk a:hover div div.event-content-break {\r\n	width:96%;\r\n	text-align:center;\r\n	height:1px;\r\n	margin-top:5px;\r\n	margin-right:2%;\r\n	padding:0;\r\n	background-color:#000000;\r\n	margin-left:0px;\r\n}\r\n.page-upcoming-events {\r\n	font-size:80%;\r\n}\r\n.page-todays-events {\r\n	font-size:80%;\r\n}\r\n.calendar-table table, .calendar-table tbody, .calendar-table tr, .calendar-table td {\r\n	margin:0 !important;\r\n	padding:0 !important;\r\n}\r\ntable.calendar-table {\r\n	margin-bottom:5px !important;\r\n}\r\n.cat-key {\r\n	width:100%;\r\n	margin-top:30px;\r\n	padding:5px;\r\n	border:0 !important;\r\n}\r\n.cal-separate {\r\n	border:0 !important;\r\n	margin-top:10px;\r\n}\r\ntable.cat-key {\r\n	margin-top:5px !important;\r\n	border:1px solid #DFE6DE !important;\r\n	border-collapse:separate !important;\r\n	border-spacing:4px !important;\r\n	margin-left:2px !important;\r\n	width:99.5% !important;\r\n	margin-bottom:5px !important;\r\n}\r\n.cat-key td {\r\n	border:0 !important;\r\n}\";s:17:\"can_manage_events\";s:10:\"edit_posts\";s:14:\"display_author\";s:5:\"false\";s:16:\"display_detailed\";s:4:\"true\";s:12:\"display_jump\";s:4:\"true\";s:14:\"display_todays\";s:4:\"true\";s:16:\"display_upcoming\";s:4:\"true\";s:21:\"display_upcoming_days\";s:1:\"7\";s:17:\"enable_categories\";s:4:\"true\";s:17:\"enable_new_window\";s:4:\"true\";}', 'yes'),
