(101, 1, 0x323031342d30362d31302030313a33303a3533, 0x323031342d30362d31302030313a33303a3533, '<p style=\"color: #000000;\">The New Dominions is the University of Virginia\'s oldest co-ed<em>a cappella</em>group. The completely student-run group dedicates itself to bringing a dynamic edge to the University\'s proudest traditions, growing in strength and ability over the last twenty five years and performing at events and concerts across the country. The New Dominions is guaranteed to please any crowd with its varied repertoire including music of all genres, from Sara Bareillesto Radiohead, and from Frankie Valli to Billy Joel. Be sure to check out the Musicpage!</p>\r\n<p style=\"color: #000000;\">Often referred to by students as the \"NewDos,\" the group was was founded in 1990 by Burt Kann, Stephen Murray and Joanna Parsons, students at the University of Virginia. The group initially served as a temporary way to teach first years the basics of a cappella so they could audition for existing groups around Grounds. Once the NewDos came to their senses and realized what a terrible idea this was, they chose to stick together and have been exploding heads with awesomeness ever since. Today, the Newdos has become the University\'s premier co-ed a cappella group and holds auditions every Fall and some Spring semesters that are open to all interested U.Va. students.</p>', 'History', '', 'inherit', 'closed', 'open', '', '100-revision-v1', '', '', 0x323031342d30362d31302030313a33303a3533, 0x323031342d30362d31302030313a33303a3533, '', 100, 'http://newdominions.com/100-revision-v1/', 0, 'revision', '', 0),
