(104, 1, 0x323031342d30362d31302030313a35383a3237, 0x323031342d30362d31302030313a35383a3237, '<h2>Why should you be a Newdo?</h2>\r\nBecause we\'re a family. That sings.\r\n\r\nSeriously though. We hope that you find us to be the perfect match for you. We think our connection with our alumni, our diverse repertoire and overall fun personality make us unique.Newdos are the University of Virginia\'s oldest co-ed a cappella group, with a rich history of 25 years. Over this time, we\'ve evolved into a very big, involved family. Our alumni (\'crusties\') are always looking to hang out, and wherever you go in life, the Newdos will support you through thick and thin. The Newdos also perform a wide variety of music, from Fleet Foxes to Delta Rae. As a Newdo, you\'ll get to travel with us all around the country to meet and perform with other a cappella groups. The Newdos are always up to fun shenanigans, so you can bet there won\'t be a dull moment in your time with us. Feel free to context us if you have any more questions!\r\n<h2>So you want to be a Newdo?</h2>\r\nAuditions will be held the first week of classes in the fall semester! We\'re always looking to get new members. You have to be a male or female student at the University of Virginia to audition. And don\'t worry - you don\'t have to have an extensive musical background to fit in. Newdos have ranged anywhere from shower-only singers to operatic geniuses.\r\n<h2>Now, how do auditions work?</h2>\r\nFirst things first, watch out for us at Rotunda Sing and the Activities fair at the beginning of the semester! We\'ll be happy to talk to you about the group and the details of auditions. Connect with us on Facebook and Twitter to get updates on dates and locations of auditions/callbacks.\r\n\r\nNext, sign up for an audition slot at the Lawn Room where auditions will take place (will be listed on Facebook and Twitter).<span style=\"color: #000000;\">Come to your audition a few minutes early to fill out an audition form.</span>We will start your audition with some warm-ups to test your vocal range. We may also ask you to do some sight-reading, blending or other exercises. Finally, you will sing your prepared solo for us. Don\'t be nervous! We\'re about the friendliest people you\'ll ever meet.\r\n\r\nYour solo, you ask?<span style=\"color: #000000;\">Come prepared with a verse and chorus of a popular song that showcases your voice. No Broadway or Disney, please. We sing popular music, so we\'d like to hear you sing a song that fits with our repertoire.At the end of auditions, we will post a callback list on the door of the audition Lawn room. We will then contact you with more specific callback information.</span>\r\n<h2>What is the time commitment?</h2>\r\n<span style=\"color: #000000;\">Like any a cappella group on Grounds, the New Dominions is a pretty big time commitment. We rehearse twice a week for 3 hoursat a time. We also have frequent gigs both on- and off-Grounds. It is definitely possible to be in involved in other organizations on Grounds  we all are  but Newdos must be a priority.</span>\r\n<h2>More questions?</h2>\r\nShoot us a message on the Contact page and we\'ll be happy to answer you in detail!', 'Auditions', '', 'inherit', 'closed', 'open', '', '103-revision-v1', '', '', 0x323031342d30362d31302030313a35383a3237, 0x323031342d30362d31302030313a35383a3237, '', 103, 'http://newdominions.com/103-revision-v1/', 0, 'revision', '', 0),
(105, 1, 0x323031372d30382d32312032323a34383a3233, 0x323031372d30382d32322030323a34383a3233, '<h2 style=\"text-align: center;\">Fall 2017 Auditions Have Arrived!</h2>\r\n<p style=\"text-align: center;\">Sign-up for an audition slot at <b><em><a title=\"Audition Page\" href=\"http://www.signupgenius.com/go/5080b4dafa923aafd0-audition\">here.</a></em></b></p>\r\n<hr>\r\n<h2 style=\"text-align: center;\"></h2>\r\n[video width=\"1280\" height=\"720\" mp4=\"http://newdominions.com/wp-content/uploads/2014/06/NewDos-Auditions.mp4\"][/video]\r\n<hr>\r\n<h2 style=\"text-align: center;\">Why should you be a Newdo?</h2>\r\nBecause we\'re a family. That sings.\r\n\r\nSeriously though. We hope that you find us to be the perfect match for you. We think our connection with our alumni, our diverse repertoire and overall fun personality make us unique.Newdos are the University of Virginia\'s oldest co-ed a cappella group, with a rich history of 25 years. Over this time, we\'ve evolved into a very big, involved family. Our alumni (\'crusties\') are always looking to hang out, and wherever you go in life, the Newdos will support you through thick and thin. The Newdos also perform a wide variety of music, from Marvin Gaye, to Fleet Foxes to Neon Trees. As a Newdo, you\'ll get to travel with us all around the country to meet and perform with other a cappella groups. The Newdos are always up to fun shenanigans, so you can bet there won\'t be a dull moment in your time with us. <strong><em>Feel free to <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">contact us</a> if you have any more questions!</em></strong>\r\n<hr>\r\n<h2 style=\"text-align: center;\">So you want to be a Newdo?</h2>\r\nAuditions will be held the first week of classes in the fall semester! Look out for specifics on our <a title=\"Events and Tickets\" href=\"http://newdominions.com/events-and-gallery/events-and-tickets/\">Events</a> page. We\'re always looking to get new members. You have to be a male or female student at the University of Virginia to audition. And don\'t worry - you don\'t have to have an extensive musical background to fit in. Newdos have ranged anywhere from shower-only singers to operatic geniuses.\r\n<hr>\r\n<h2 style=\"text-align: center;\">How do auditions work?</h2>\r\nThere are four simple steps:\r\n<ul>\r\n 	<li>First, get to know us. Come out to Rotunda Sing and connect with us on <strong><a href=\"https://www.facebook.com/newdominions\">Facebook</a>, <a href=\"https://twitter.com/NewDominions\">Twitter</a> or <a href=\"https://instagram.com/newdominions/\">Instagram</a></strong>! Meet the group at the Student Activities Fair, where we will answer all your questions and you will get a feel for the group.</li>\r\n 	<li>Second, sign up for an audition slot (find details on our Facebook page); we also do walk-ins, but wait times can be long. <strong>Come early to fill out an info sheet</strong>, and youre set!</li>\r\n 	<li>Third, the audition. Well start with warm-ups to understand your range. Come prepared with a <strong>verse and chorus of a popular song</strong> to sing for your solo (no Disney, Broadway, or rap pretty please!). We may also ask you to do other musical exercises.</li>\r\n 	<li>Lastly, at the end of auditions, <strong>we post a callback list on the audition room</strong>. We will contact those invited to a callback with more details!</li>\r\n</ul>\r\n<hr>\r\n<h2 style=\"text-align: center;\">What is the time commitment?</h2>\r\n<span style=\"color: #000000;\">Like any a cappella group on Grounds, the New Dominions is a pretty big time commitment. We rehearse twice a week for 3 hoursat a time. We also have frequent gigs both on- and off-Grounds. It is definitely possible to be in involved in other organizations on Grounds  we all are  but Newdos must be a priority.</span>\r\n<hr>\r\n<h2 style=\"text-align: center;\">More questions?</h2>\r\nShoot us a message on the <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">Contact page</a> and we\'ll be happy to answer you in detail!', 'Auditions', '', 'inherit', 'closed', 'open', '', '103-autosave-v1', '', '', 0x323031372d30382d32312032323a34383a3233, 0x323031372d30382d32322030323a34383a3233, '', 103, 'http://newdominions.com/103-autosave-v1/', 0, 'revision', '', 0),
