(113, 1, 0x323031362d30382d32322031343a35373a3230, 0x323031362d30382d32322031383a35373a3230, '<!--more-->\n\n<span style=\"color: #000000;\">The New Dominions have </span>25 years of live performance experience, and we would love to sing at your next event! We are honored to have performed at a variety of events, including singing for the <a href=\"http://www.jeffersonscholars.org/\">UVa Jefferson Scholars Foundation</a>, at the <a href=\"https://www.facebook.com/VirginiaCavaliers/photos/a.10152715896082635.1073742149.73947377634/10152715977487635/?type=1&amp;permPage=1\">UVa vs. Duke basketball game</a>, and the <a href=\"http://virginiafilmfestival.org/\">Virginia Film Festival,</a> as well as weddings, retirement homes, birthday parties, and charity functions.\n\nWe are happy to cater our song set to meet your events unique needs. Contactus with details about your event, or any questions that you may have! Rates and availability may vary.\n\n<span style=\"color: #000000;\">We also look forward to hosting other groups during their tours, getting the opportunity to sing with them, and showing them the best of U.Va. D</span>rop us a note with any performance requests, questions, comments, or song suggestions. We\'d love to hear from you!\n\n<img class=\"alignleft wp-image-654 size-full\" src=\"http://newdominions.com/wp-content/uploads/2014/06/10847575_10152715977487635_1640182007995211809_o.jpg\" alt=\"Contact Us - Duke Game\" width=\"2048\" height=\"1281\" />\n<p style=\"text-align: left;\"></p>', 'Contact Us', '', 'inherit', 'closed', 'open', '', '111-autosave-v1', '', '', 0x323031362d30382d32322031343a35373a3230, 0x323031362d30382d32322031383a35373a3230, '', 111, 'http://newdominions.com/111-autosave-v1/', 0, 'revision', '', 0),
(114, 1, 0x323031342d30362d31302030323a30393a3437, 0x323031342d30362d31302030323a30393a3437, '<span style=\"color: #000000;\">The New Dominions have twenty-five years of live performance experience, and we\'d love to sing for your next event! No matter the size or location  all we need is an audience. We also look forward to hosting other groups during their tours, getting the opportunity to sing with them, and showing them the best of U.Va. So, drop us a note with any performance requests, questions, comments, or song suggestions. We\'d love to hear from you!</span>', 'Contact Us', '', 'inherit', 'closed', 'open', '', '111-revision-v1', '', '', 0x323031342d30362d31302030323a30393a3437, 0x323031342d30362d31302030323a30393a3437, '', 111, 'http://newdominions.com/111-revision-v1/', 0, 'revision', '', 0),
