(117, 1, 0x323031342d30362d31302030323a31373a3133, 0x323031342d30362d31302030323a31373a3133, '<span style=\"color: #000000;\">The New Dominions have twenty-five years of live performance experience, and we\'d love to sing for your next event! No matter the size or location  all we need is an audience. We also look forward to hosting other groups during their tours, getting the opportunity to sing with them, and showing them the best of U.Va. So, drop us a note with any performance requests, questions, comments, or song suggestions. We\'d love to hear from you!</span>\r\n<p style=\"text-align: left;\"><a href=\"http://newdominions.com/wp-content/uploads/2014/06/IMG_1447.jpg\"><img class=\"alignleft wp-image-116 size-full\" src=\"http://newdominions.com/wp-content/uploads/2014/06/IMG_1447.jpg\" alt=\"IMG_1447\" width=\"3345\" height=\"2215\" /></a></p>', 'Contact Us', '', 'inherit', 'closed', 'open', '', '111-revision-v1', '', '', 0x323031342d30362d31302030323a31373a3133, 0x323031342d30362d31302030323a31373a3133, '', 111, 'http://newdominions.com/111-revision-v1/', 0, 'revision', '', 0),
