(649, 1, 0x323031352d30322d30392031363a35373a3036, 0x323031352d30322d30392032313a35373a3036, 'We\'ve been making music for over 20 years. All proceeds from sales go directly to helping us produce more CDs so we can keep making music, so head on over to the <a href=\"https://itunes.apple.com/us/artist/new-dominions/id287225725?uo=4\" target=\"itunes_store\">New Dominions</a> iTunes page to purchase our CDs! Our newest albums are also available on<a href=\"http://https://loudr.fm/artist/the-new-dominions/d6z5Z\"> Loudr.FM </a>for online download. If you would like to make an additional donation or purchase our older CDs, please <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">contact us</a>! We will be forever grateful.\r\n\r\n[playlist ids=\"637,638,639,640,641,642,643,644,645,646,647,648\"]\r\n\r\nClick on the images to find the track listing for the CDs!\r\n\r\n[columns] [span3]\r\n\r\n&nbsp;\r\n\r\n<a href=\"http://newdominions.com/music/boxed-or-hung-1998/\"><img class=\"aligncenter wp-image-78 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/boxed_or_hung-150x150.jpg\" alt=\"boxed_or_hung\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Boxed or Hung (1998)</p>\r\n[/span3][span3]\r\n\r\n&nbsp;\r\n<p style=\"text-align: center;\"><a href=\"http://newdominions.com/music/whatthehellhappened-2000/\"><img class=\"alignnone wp-image-75 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/whatthehellhappened-150x150.jpg\" alt=\"whatthehellhappened\" width=\"150\" height=\"150\" /></a></p>\r\n<p style=\"text-align: center;\">Whatthehellhappened? (2000)</p>\r\n[/span3][span3]\r\n\r\n&nbsp;\r\n\r\n<a href=\"http://newdominions.com/music/live-and-let-da-2002/\"><img class=\"aligncenter wp-image-72 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/live_and_let_da-150x150.jpg\" alt=\"live_and_let_da\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Live and Let Da (2002)</p>\r\n[/span3][span3]\r\n\r\n&nbsp;\r\n\r\n<a href=\"http://newdominions.com/music/your-mom-2003/\"><img class=\"aligncenter wp-image-69 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/your_mom-150x150.jpg\" alt=\"your_mom\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Your Mom (2003)</p>\r\n[/span3][/columns]\r\n\r\n[columns] [span3]\r\n\r\n<a href=\"http://newdominions.com/music/ya-heard-2005/\"><img class=\"aligncenter wp-image-66 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/ya_heard-150x150.jpg\" alt=\"ya_heard\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Ya Heard? (2005)</p>\r\n[/span3][span3]\r\n\r\n<a href=\"http://newdominions.com/music/almost-awesome-2006/\"><img class=\"aligncenter wp-image-63 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/almost_awesome-150x150.jpg\" alt=\"almost_awesome\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Almost Awesome (2006)</p>\r\n[/span3][span3]\r\n\r\n<a href=\"http://newdominions.com/music/exit-only-2007/\"><img class=\"aligncenter wp-image-59 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/exit_only-150x150.jpg\" alt=\"exit_only\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Exit Only (2007)</p>\r\n[/span3][span3]\r\n\r\n<a href=\"http://newdominions.com/music/tip-your-barista-2010/\"><img class=\"aligncenter wp-image-56 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/tip_your_barista-150x150.jpg\" alt=\"tip_your_barista\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Tip Your Barista (2010)</p>\r\n[/span3][/columns]\r\n\r\n[columns] [span3]\r\n\r\n<a href=\"http://newdominions.com/music/boxer-breakfast-2011/\"><img class=\"aligncenter wp-image-50 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/boxer_breakfast-150x150.jpg\" alt=\"boxer_breakfast\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Boxer Breakfast (2011)</p>\r\n[/span3][span3]\r\n\r\n<a href=\"http://newdominions.com/music/porch-time-2013/\"><img class=\"aligncenter wp-image-46 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/05/porch-time-150x150.jpg\" alt=\"porch time\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Porch Time (2013)</p>\r\n[/span3][span3]\r\n\r\n<a href=\"http://newdominions.com/music/23-degrees-2014/\"><img class=\"aligncenter wp-image-475\" src=\"http://newdominions.com/wp-content/uploads/2014/11/23-degrees-final-200x200.jpg\" alt=\"23 degrees final\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">23 Degrees (2014)</p>\r\n[/span3][span3]\r\n\r\n&nbsp;\r\n\r\n[/span3][/columns]', 'Music', '', 'inherit', 'closed', 'open', '', '267-revision-v1', '', '', 0x323031352d30322d30392031363a35373a3036, 0x323031352d30322d30392032313a35373a3036, '', 267, 'http://newdominions.com/267-revision-v1/', 0, 'revision', '', 0),
