(281, 1, 0x323031342d30362d31302032323a33373a3435, 0x323031342d30362d31302032323a33373a3435, '<h2 style=\"text-align: center;\"><a href=\"http://newdominions.com/wp-content/uploads/2014/06/beach-week-2014.jpg\"><img class=\"aligncenter wp-image-108 size-full\" src=\"http://newdominions.com/wp-content/uploads/2014/06/beach-week-2014.jpg\" alt=\"beach week 2014\" width=\"3824\" height=\"2481\" /></a></h2>\r\n<h2 style=\"text-align: center;\">Why should you be a Newdo?</h2>\r\nBecause we\'re a family. That sings.\r\n\r\nSeriously though. We hope that you find us to be the perfect match for you. We think our connection with our alumni, our diverse repertoire and overall fun personality make us unique.Newdos are the University of Virginia\'s oldest co-ed a cappella group, with a rich history of 25 years. Over this time, we\'ve evolved into a very big, involved family. Our alumni (\'crusties\') are always looking to hang out, and wherever you go in life, the Newdos will support you through thick and thin. The Newdos also perform a wide variety of music, from Fleet Foxes to Delta Rae. As a Newdo, you\'ll get to travel with us all around the country to meet and perform with other a cappella groups. The Newdos are always up to fun shenanigans, so you can bet there won\'t be a dull moment in your time with us. Feel free to <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">contact us</a> if you have any more questions!\r\n<h2 style=\"text-align: center;\">So you want to be a Newdo?</h2>\r\nAuditions will be held the first week of classes in the fall semester! We\'re always looking to get new members. You have to be a male or female student at the University of Virginia to audition. And don\'t worry - you don\'t have to have an extensive musical background to fit in. Newdos have ranged anywhere from shower-only singers to operatic geniuses.\r\n<h2 style=\"text-align: center;\">Now, how do auditions work?</h2>\r\nFirst things first, watch out for us at Rotunda Sing and the Activities fair at the beginning of the semester! We\'ll be happy to talk to you about the group and the details of auditions. Connect with us on <a href=\"www.facebook.com/newdominions\">Facebook</a> and <a href=\"http://twitter.com/NewDominions\">Twitter</a> to get updates on dates and locations of auditions/callbacks.\r\n\r\nNext, sign up for an audition slot at the Lawn Room where auditions will take place (will be listed on Facebook and Twitter).<span style=\"color: #000000;\">Come to your audition a few minutes early to fill out an audition form.</span>We will start your audition with some warm-ups to test your vocal range. We may also ask you to do some sight-reading, blending or other exercises. Finally, you will sing your prepared solo for us. Don\'t be nervous! We\'re about the friendliest people you\'ll ever meet.\r\n\r\nYour solo, you ask?<span style=\"color: #000000;\">Come prepared with a verse and chorus of a popular song that showcases your voice. No Broadway or Disney, please. We sing popular music, so we\'d like to hear you sing a song that fits with our repertoire.At the end of auditions, we will post a callback list on the door of the audition Lawn room. We will then contact you with more specific callback information.</span>\r\n<h2 style=\"text-align: center;\">What is the time commitment?</h2>\r\n<span style=\"color: #000000;\">Like any a cappella group on Grounds, the New Dominions is a pretty big time commitment. We rehearse twice a week for 3 hoursat a time. We also have frequent gigs both on- and off-Grounds. It is definitely possible to be in involved in other organizations on Grounds  we all are  but Newdos must be a priority.</span>\r\n<h2 style=\"text-align: center;\">More questions?</h2>\r\nShoot us a message on the <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">Contact page</a> and we\'ll be happy to answer you in detail!\r\n\r\n&nbsp;', 'Auditions', '', 'inherit', 'closed', 'open', '', '103-revision-v1', '', '', 0x323031342d30362d31302032323a33373a3435, 0x323031342d30362d31302032323a33373a3435, '', 103, 'http://newdominions.com/103-revision-v1/', 0, 'revision', '', 0),
