(307, 1, 0x323031372d30382d32302031393a33343a3433, 0x323031372d30382d32302032333a33343a3433, '<p style=\"color: #000000; text-align: left;\">The New Dominions is the University of Virginia\'s oldest co-ed<em>a cappella</em>group and we have 27 years worth of history. The completely student-run group dedicates itself to bringing a dynamic edge to the University\'s proudest traditions, growing in strength and ability over the last twenty-seven years and performing at events and concerts across the country. The New Dominions is guaranteed to please any crowd with its varied repertoire including music of all genres, from Michael Jackson to Radiohead, and from the Civil Wars to Ariana Grande. Be sure to check out the <a title=\"Music\" href=\"http://newdominions.com/music/\">Music</a>page!</p>\n<p style=\"color: #000000;\">Often referred to by students as the \"NewDos,\" the group was was founded in 1990 by Burt Kann, Stephen Murray and Joanna Parsons, students at the University of Virginia. The group initially served as a temporary way to teach first years the basics of a cappella so they could audition for existing groups around Grounds. Soon, the NewDos came to their senses, realized what a terrible idea this was. We chose to stick together and have been recording albums, touring the nation, and kicking ass ever since. Today, the Newdos have become the University\'s premier co-ed a cappella group. Auditions are heldevery Fall and some Spring semesters that are open to all interested U.Va. students. Follow us on our <a href=\"www.facebook.com/newdominions\">Facebook </a>and <a href=\"https://twitter.com/newdominions\">Twitter </a>pages to keep up with us.</p>\n[columns] [span4]\n\n<img class=\"alignleft wp-image-302 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/06/26886_934106051833_2252827_n-300x200.jpg\" alt=\"20th anniversary history\" width=\"300\" height=\"200\" />\n\n[/span4][span4]\n\n<img class=\"aligncenter wp-image-303 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/06/577319_10150712262659613_631252736_n-300x200.jpg\" alt=\"NewDo history\" width=\"300\" height=\"200\" />\n\n[/span4][span4]\n\n<img class=\"alignright wp-image-301 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/06/26886_933626437983_256510_n-300x200.jpg\" alt=\"NewDo 20th history\" width=\"300\" height=\"200\" />\n\n[/span4][/columns]\n<p style=\"color: #000000;\"></p>', 'History', '', 'inherit', 'closed', 'open', '', '100-autosave-v1', '', '', 0x323031372d30382d32302031393a33343a3433, 0x323031372d30382d32302032333a33343a3433, '', 100, 'http://newdominions.com/100-autosave-v1/', 0, 'revision', '', 0),
(308, 1, 0x323031342d30382d30342030363a32313a3233, 0x323031342d30382d30342031303a32313a3233, '<p style=\"color: #000000; text-align: left;\">The New Dominions is the University of Virginia\'s oldest co-ed<em>a cappella</em>group. The completely student-run group dedicates itself to bringing a dynamic edge to the University\'s proudest traditions, growing in strength and ability over the last twenty five years and performing at events and concerts across the country. The New Dominions is guaranteed to please any crowd with its varied repertoire including music of all genres, from Sara Bareillesto Radiohead, and from Frankie Valli to Billy Joel. Be sure to check out the Musicpage!</p>\r\n<p style=\"color: #000000;\">Often referred to by students as the \"NewDos,\" the group was was founded in 1990 by Burt Kann, Stephen Murray and Joanna Parsons, students at the University of Virginia. The group initially served as a temporary way to teach first years the basics of a cappella so they could audition for existing groups around Grounds. Once the NewDos came to their senses and realized what a terrible idea this was, they chose to stick together and have been exploding heads with awesomeness ever since. Today, the Newdos has become the University\'s premier co-ed a cappella group and holds auditions every Fall and some Spring semesters that are open to all interested U.Va. students.</p>\r\n[columns] [span4]\r\n\r\n<img class=\"alignleft size-medium wp-image-302\" src=\"http://newdominions.com/wp-content/uploads/2014/06/26886_934106051833_2252827_n-300x200.jpg\" alt=\"26886_934106051833_2252827_n\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][span4]\r\n\r\n<img class=\"aligncenter size-medium wp-image-303\" src=\"http://newdominions.com/wp-content/uploads/2014/06/577319_10150712262659613_631252736_n-300x200.jpg\" alt=\"577319_10150712262659613_631252736_n\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][span4]\r\n\r\n<img class=\"alignright size-medium wp-image-301\" src=\"http://newdominions.com/wp-content/uploads/2014/06/26886_933626437983_256510_n-300x200.jpg\" alt=\"26886_933626437983_256510_n\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][/columns]\r\n<p style=\"color: #000000;\"></p>\r\n<p style=\"color: #000000;\"></p>', 'History', '', 'inherit', 'closed', 'open', '', '100-revision-v1', '', '', 0x323031342d30382d30342030363a32313a3233, 0x323031342d30382d30342031303a32313a3233, '', 100, 'http://newdominions.com/100-revision-v1/', 0, 'revision', '', 0),
(309, 1, 0x323031342d30382d30342030363a32353a3230, 0x323031342d30382d30342031303a32353a3230, 'We\'ve been making music for over 20 years. All proceeds from sales go directly to helping us produce more CDs so we can keep making music, so head on over to our iTunes page to purchase our CDs! If you would like to make an additional donation, please <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">contact us</a>! We will be forever grateful.\r\n\r\n[playlist images=\"false\" artists=\"false\" ids=\"121,122,123,124,125,126,127,128,129,130,131\"]', 'Music', '', 'inherit', 'closed', 'open', '', '267-revision-v1', '', '', 0x323031342d30382d30342030363a32353a3230, 0x323031342d30382d30342031303a32353a3230, '', 267, 'http://newdominions.com/267-revision-v1/', 0, 'revision', '', 0),
