(393, 1, 0x323031342d30382d31302031303a32373a3136, 0x323031342d30382d31302031343a32373a3136, '<h2 style=\"text-align: center;\"><a href=\"http://newdominions.com/wp-content/uploads/2014/06/beach-week-2014.jpg\"><img class=\"aligncenter wp-image-108 size-large\" src=\"http://newdominions.com/wp-content/uploads/2014/06/beach-week-2014-1024x664.jpg\" alt=\"beach week 2014\" width=\"940\" height=\"609\" /></a></h2>\r\n<h2 style=\"text-align: center;\">Why should you be a Newdo?</h2>\r\nBecause we\'re a family. That sings.\r\n\r\nSeriously though. We hope that you find us to be the perfect match for you. We think our connection with our alumni, our diverse repertoire and overall fun personality make us unique.Newdos are the University of Virginia\'s oldest co-ed a cappella group, with a rich history of 25 years. Over this time, we\'ve evolved into a very big, involved family. Our alumni (\'crusties\') are always looking to hang out, and wherever you go in life, the Newdos will support you through thick and thin. The Newdos also perform a wide variety of music, from Fleet Foxes to Delta Rae. As a Newdo, you\'ll get to travel with us all around the country to meet and perform with other a cappella groups. The Newdos are always up to fun shenanigans, so you can bet there won\'t be a dull moment in your time with us. Feel free to <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">contact us</a> if you have any more questions!\r\n<h2 style=\"text-align: center;\">So you want to be a Newdo?</h2>\r\nAuditions will be held the first week of classes in the fall semester! We\'re always looking to get new members. You have to be a male or female student at the University of Virginia to audition. And don\'t worry - you don\'t have to have an extensive musical background to fit in. Newdos have ranged anywhere from shower-only singers to operatic geniuses.\r\n<h2 style=\"text-align: center;\">Now, how do auditions work?</h2>\r\nFirst things first, watch out for us at Rotunda Sing and the Activities fair at the beginning of the semester! We\'ll be happy to talk to you about the group and the details of auditions. Connect with us on <a href=\"www.facebook.com/newdominions\">Facebook</a> and <a href=\"http://twitter.com/NewDominions\">Twitter</a> to get updates on dates and locations of auditions/callbacks.\r\n\r\nNext, sign up for an audition slot at the Lawn Room where auditions will take place (will be listed on Facebook and Twitter).<span style=\"color: #000000;\">Come to your audition a few minutes early to fill out an audition form.</span>We will start your audition with some warm-ups to test your vocal range. We may also ask you to do some sight-reading, blending or other exercises. Finally, you will sing your prepared solo for us. Don\'t be nervous! We\'re about the friendliest people you\'ll ever meet.\r\n\r\nYour solo, you ask?<span style=\"color: #000000;\">Come prepared with a verse and chorus of a popular song that showcases your voice. No Broadway or Disney, please. We sing popular music, so we\'d like to hear you sing a song that fits with our repertoire.At the end of auditions, we will post a callback list on the door of the audition Lawn room. We will then contact you with more specific callback information.</span>\r\n<h2 style=\"text-align: center;\">What is the time commitment?</h2>\r\n<span style=\"color: #000000;\">Like any a cappella group on Grounds, the New Dominions is a pretty big time commitment. We rehearse twice a week for 3 hoursat a time. We also have frequent gigs both on- and off-Grounds. It is definitely possible to be in involved in other organizations on Grounds  we all are  but Newdos must be a priority.</span>\r\n<h2 style=\"text-align: center;\">More questions?</h2>\r\nShoot us a message on the <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">Contact page</a> and we\'ll be happy to answer you in detail!\r\n\r\n&nbsp;', 'Auditions', '', 'inherit', 'closed', 'open', '', '103-revision-v1', '', '', 0x323031342d30382d31302031303a32373a3136, 0x323031342d30382d31302031343a32373a3136, '', 103, 'http://newdominions.com/103-revision-v1/', 0, 'revision', '', 0),
(394, 1, 0x323031342d30382d31302031303a33303a3131, 0x323031342d30382d31302031343a33303a3131, '<h2 style=\"text-align: center;\"><a href=\"http://newdominions.com/wp-content/uploads/2014/06/beach-week-2014.jpg\"><img class=\"aligncenter wp-image-108 size-large\" src=\"http://newdominions.com/wp-content/uploads/2014/06/beach-week-2014-1024x664.jpg\" alt=\"beach week 2014\" width=\"940\" height=\"609\" /></a></h2>\r\n<h2 style=\"text-align: center;\">Why should you be a Newdo?</h2>\r\nBecause we\'re a family. That sings.\r\n\r\nSeriously though. We hope that you find us to be the perfect match for you. We think our connection with our alumni, our diverse repertoire and overall fun personality make us unique.Newdos are the University of Virginia\'s oldest co-ed a cappella group, with a rich history of 25 years. Over this time, we\'ve evolved into a very big, involved family. Our alumni (\'crusties\') are always looking to hang out, and wherever you go in life, the Newdos will support you through thick and thin. The Newdos also perform a wide variety of music, from Fleet Foxes to Delta Rae. As a Newdo, you\'ll get to travel with us all around the country to meet and perform with other a cappella groups. The Newdos are always up to fun shenanigans, so you can bet there won\'t be a dull moment in your time with us. Feel free to <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">contact us</a> if you have any more questions!\r\n<h2 style=\"text-align: center;\">So you want to be a Newdo?</h2>\r\nAuditions will be held the first week of classes in the fall semester! Look out for specifics on our <a title=\"Events\" href=\"http://newdominions.com/events/\">Events</a> page. We\'re always looking to get new members. You have to be a male or female student at the University of Virginia to audition. And don\'t worry - you don\'t have to have an extensive musical background to fit in. Newdos have ranged anywhere from shower-only singers to operatic geniuses.\r\n<h2 style=\"text-align: center;\">Now, how do auditions work?</h2>\r\nFirst things first, watch out for us at Rotunda Sing and the Activities fair at the beginning of the semester! We\'ll be happy to talk to you about the group and the details of auditions. Connect with us on <a href=\"https://www.facebook.com/newdominions\">Facebook</a> and <a href=\"http://twitter.com/NewDominions\">Twitter</a> to get updates on dates and locations of auditions/callbacks.\r\n\r\nNext, sign up for an audition slot at the Lawn Room where auditions will take place (will be listed on Facebook and Twitter).<span style=\"color: #000000;\">Come to your audition a few minutes early to fill out an audition form.</span>We will start your audition with some warm-ups to test your vocal range. We may also ask you to do some sight-reading, blending or other exercises. Finally, you will sing your prepared solo for us. Don\'t be nervous! We\'re about the friendliest people you\'ll ever meet.\r\n\r\nYour solo, you ask?<span style=\"color: #000000;\">Come prepared with a verse and chorus of a popular song that showcases your voice. No Broadway or Disney, please. We sing popular music, so we\'d like to hear you sing a song that fits with our repertoire.At the end of auditions, we will post a callback list on the door of the audition Lawn room. We will then contact you with more specific callback information.</span>\r\n<h2 style=\"text-align: center;\">What is the time commitment?</h2>\r\n<span style=\"color: #000000;\">Like any a cappella group on Grounds, the New Dominions is a pretty big time commitment. We rehearse twice a week for 3 hoursat a time. We also have frequent gigs both on- and off-Grounds. It is definitely possible to be in involved in other organizations on Grounds  we all are  but Newdos must be a priority.</span>\r\n<h2 style=\"text-align: center;\">More questions?</h2>\r\nShoot us a message on the <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">Contact page</a> and we\'ll be happy to answer you in detail!\r\n\r\n&nbsp;', 'Auditions', '', 'inherit', 'closed', 'open', '', '103-revision-v1', '', '', 0x323031342d30382d31302031303a33303a3131, 0x323031342d30382d31302031343a33303a3131, '', 103, 'http://newdominions.com/103-revision-v1/', 0, 'revision', '', 0),
(395, 1, 0x323031342d30382d31302031303a34313a3536, 0x323031342d30382d31302031343a34313a3536, 'We\'ve been making music for over 20 years. All proceeds from sales go directly to helping us produce more CDs so we can keep making music, so head on over to the <a href=\"https://itunes.apple.com/us/artist/new-dominions/id287225725?uo=4\" target=\"itunes_store\">New Dominions</a> iTunes page to purchase our CDs! If you would like to make an additional donation or purchase our older CDs, please <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">contact us</a>! We will be forever grateful.\r\n\r\n[playlist images=\"false\" artists=\"false\" ids=\"121,122,123,124,125,126,127,128,129,130,131\"]\r\n\r\n[columns] [span3]\r\n\r\n<img class=\"aligncenter size-thumbnail wp-image-46\" src=\"http://newdominions.com/wp-content/uploads/2014/05/porch-time-150x150.jpg\" alt=\"porch time\" width=\"150\" height=\"150\" />\r\n\r\nPorch Time (2013)\r\n\r\n[/span3][span3]\r\n\r\n<img class=\"aligncenter size-thumbnail wp-image-50\" src=\"http://newdominions.com/wp-content/uploads/2014/06/boxer_breakfast-150x150.jpg\" alt=\"boxer_breakfast\" width=\"150\" height=\"150\" />\r\n\r\nBoxer Breakfast (2011)\r\n\r\n[/span3][span3]\r\n\r\n<img class=\"aligncenter size-thumbnail wp-image-56\" src=\"http://newdominions.com/wp-content/uploads/2014/06/tip_your_barista-150x150.jpg\" alt=\"tip_your_barista\" width=\"150\" height=\"150\" />\r\n\r\nTip Your Barista (2010)\r\n\r\n[/span3][span3]\r\n\r\n<img class=\"aligncenter size-thumbnail wp-image-59\" src=\"http://newdominions.com/wp-content/uploads/2014/06/exit_only-150x150.jpg\" alt=\"exit_only\" width=\"150\" height=\"150\" />\r\n\r\nExit Only (2007)\r\n\r\n[/span3][/columns]\r\n\r\n[columns] [span3]\r\n\r\n<img class=\"aligncenter size-thumbnail wp-image-63\" src=\"http://newdominions.com/wp-content/uploads/2014/06/almost_awesome-150x150.jpg\" alt=\"almost_awesome\" width=\"150\" height=\"150\" />\r\n\r\nAlmost Awesome (2006)\r\n\r\