(396, 1, 0x323031342d30382d31302031303a34333a3436, 0x323031342d30382d31302031343a34333a3436, 'If you have a Paypal account, or are willing to create one, you can now buy tickets online! Just be sure to show up 15 minutes before the concert to pick up your tickets from will call. You can also buy tickets from us directly on the lawn (or Newcomb Hall, if the weather warrants it), or at the door!\r\n\r\n[ESPRESSO_EVENTS]\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Buy Tickets Online', '', 'inherit', 'closed', 'open', '', '349-revision-v1', '', '', 0x323031342d30382d31302031303a34333a3436, 0x323031342d30382d31302031343a34333a3436, '', 349, 'http://newdominions.com/349-revision-v1/', 0, 'revision', '', 0);
