(438, 1, 0x323031342d30382d31302031333a31323a3133, 0x323031342d30382d31302031373a31323a3133, '<p style=\"color: #000000; text-align: left;\">The New Dominions is the University of Virginia\'s oldest co-ed<em>a cappella</em>group. The completely student-run group dedicates itself to bringing a dynamic edge to the University\'s proudest traditions, growing in strength and ability over the last twenty five years and performing at events and concerts across the country. The New Dominions is guaranteed to please any crowd with its varied repertoire including music of all genres, from Sara Bareillesto Radiohead, and from Frankie Valli to Billy Joel. Be sure to check out the <a title=\"Music\" href=\"http://newdominions.com/music/\">Music</a>page!</p>\r\n<p style=\"color: #000000;\">Often referred to by students as the \"NewDos,\" the group was was founded in 1990 by Burt Kann, Stephen Murray and Joanna Parsons, students at the University of Virginia. The group initially served as a temporary way to teach first years the basics of a cappella so they could audition for existing groups around Grounds. Once the NewDos came to their senses and realized what a terrible idea this was, they chose to stick together and have been exploding heads with awesomeness ever since. Today, the Newdos has become the University\'s premier co-ed a cappella group and holds auditions every Fall and some Spring semesters that are open to all interested U.Va. students.</p>\r\n[columns] [span4]\r\n\r\n<img class=\"alignleft size-medium wp-image-302\" src=\"http://newdominions.com/wp-content/uploads/2014/06/26886_934106051833_2252827_n-300x200.jpg\" alt=\"26886_934106051833_2252827_n\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][span4]\r\n\r\n<img class=\"aligncenter size-medium wp-image-303\" src=\"http://newdominions.com/wp-content/uploads/2014/06/577319_10150712262659613_631252736_n-300x200.jpg\" alt=\"577319_10150712262659613_631252736_n\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][span4]\r\n\r\n<img class=\"alignright size-medium wp-image-301\" src=\"http://newdominions.com/wp-content/uploads/2014/06/26886_933626437983_256510_n-300x200.jpg\" alt=\"26886_933626437983_256510_n\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][/columns]\r\n<p style=\"color: #000000;\"></p>', 'History', '', 'inherit', 'closed', 'open', '', '100-revision-v1', '', '', 0x323031342d30382d31302031333a31323a3133, 0x323031342d30382d31302031373a31323a3133, '', 100, 'http://newdominions.com/100-revision-v1/', 0, 'revision', '', 0),
(439, 1, 0x323031342d30382d31302031333a31333a3539, 0x323031342d30382d31302031373a31333a3539, '<h2 style=\"text-align: center;\"><a href=\"http://newdominions.com/wp-content/uploads/2014/06/beach-week-2014.jpg\"><img class=\"aligncenter wp-image-108 size-large\" src=\"http://newdominions.com/wp-content/uploads/2014/06/beach-week-2014-1024x664.jpg\" alt=\"beach week 2014\" width=\"940\" height=\"609\" /></a></h2>\r\n<h2 style=\"text-align: center;\">Why should you be a Newdo?</h2>\r\nBecause we\'re a family. That sings.\r\n\r\nSeriously though. We hope that you find us to be the perfect match for you. We think our connection with our alumni, our diverse repertoire and overall fun personality make us unique.Newdos are the University of Virginia\'s oldest co-ed a cappella group, with a rich history of 25 years. Over this time, we\'ve evolved into a very big, involved family. Our alumni (\'crusties\') are always looking to hang out, and wherever you go in life, the Newdos will support you through thick and thin. The Newdos also perform a wide variety of music, from Fleet Foxes to Delta Rae. As a Newdo, you\'ll get to travel with us all around the country to meet and perform with other a cappella groups. The Newdos are always up to fun shenanigans, so you can bet there won\'t be a dull moment in your time with us. Feel free to <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">contact us</a> if you have any more questions!\r\n<h2 style=\"text-align: center;\">So you want to be a Newdo?</h2>\r\nAuditions will be held the first week of classes in the fall semester! Look out for specifics on our <a title=\"Events and Tickets\" href=\"http://newdominions.com/events-and-gallery/events-and-tickets/\">Events</a> page. We\'re always looking to get new members. You have to be a male or female student at the University of Virginia to audition. And don\'t worry - you don\'t have to have an extensive musical background to fit in. Newdos have ranged anywhere from shower-only singers to operatic geniuses.\r\n<h2 style=\"text-align: center;\">Now, how do auditions work?</h2>\r\nFirst things first, watch out for us at Rotunda Sing and the Activities fair at the beginning of the semester! We\'ll be happy to talk to you about the group and the details of auditions. Connect with us on <a href=\"https://www.facebook.com/newdominions\">Facebook</a> and <a href=\"http://twitter.com/NewDominions\">Twitter</a> to get updates on dates and locations of auditions/callbacks.\r\n\r\nNext, sign up for an audition slot at the Lawn Room where auditions will take place (will be listed on Facebook and Twitter).<span style=\"color: #000000;\">Come to your audition a few minutes early to fill out an audition form.</span>We will start your audition with some warm-ups to test your vocal range. We may also ask you to do some sight-reading, blending or other exercises. Finally, you will sing your prepared solo for us. Don\'t be nervous! We\'re about the friendliest people you\'ll ever meet.\r\n\r\nYour solo, you ask?<span style=\"color: #000000;\">Come prepared with a verse and chorus of a popular song that showcases your voice. No Broadway or Disney, please. We sing popular music, so we\'d like to hear you sing a song that fits with our repertoire.At the end of auditions, we will post a callback list on the door of the audition Lawn room. We will then contact you with more specific callback information.</span>\r\n<h2 style=\"text-align: center;\">What is the time commitment?</h2>\r\n<span style=\"color: #000000;\">Like any a cappella group on Grounds, the New Dominions is a pretty big time commitment. We rehearse twice a week for 3 hoursat a time. We also have frequent gigs both on- and off-Grounds. It is definitely possible to be in involved in other organizations on Grounds  we all are  but Newdos must be a priority.</span>\r\n<h2 style=\"text-align: center;\">More questions?</h2>\r\nShoot us a message on the <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">Contact page</a> and we\'ll be happy to answer you in detail!\r\n\r\n&nbsp;', 'Auditions', '', 'inherit', 'closed', 'open', '', '103-revision-v1', '', '', 0x323031342d30382d31302031333a31333a3539, 0x323031342d30382d31302031373a31333a3539, '', 103, 'http://newdominions.com/103-revision-v1/', 0, 'revision', '', 0),
(455, 1, 0x323031342d30392d31302031343a30303a3432, 0x323031342d30392d31302031383a30303a3432, '<span style=\"color: #222222;\"><img class=\"alignleft wp-image-468 \" src=\"http://newdominions.com/wp-content/uploads/2014/09/image-200x200.jpeg\" alt=\"image\" width=\"224\" height=\"224\" /></span>\r\n<strong>Voice Part:</strong> Baritone\r\n<strong>Major:</strong> Cognitive Science\r\n<strong>Hometown:</strong> Chesapeake, VA\r\n<strong>Yes To:</strong> the dress, sushi, all things Leonardo DiCaprio related, and hip hop\r\n<strong>No to:</strong> mustard and/or relish on hot dogs, accidentally getting water up your sleeve while washing your hands, quick sand, and hiccups\r\n<strong>Audition Songs:</strong>\r\nSanteria\r\nI Miss You\r\n<strong>Favorite Newdos Songs:</strong>\r\nI Took A Pill In Ibiza', 'Nick Onley (Fourth Year)', '', 'publish', 'closed', 'closed', '', 'nick-onley-fourth-year', '', '', 0x323031372d30382d32302031393a30313a3236, 0x323031372d30382d32302032333a30313a3236, '', 168, 'http://newdominions.com/?page_id=455', 0, 'page', '', 0),
