(555, 1, 0x323031342d31322d32322030383a34343a3438, 0x323031342d31322d32322031333a34343a3438, 'Besides being a professional a cappella group, we\'re also best friends. Here are photos of the NewDos hanging out and being...NewDos.\r\n\r\n[columns] [span4]\r\n\r\n[caption id=\"attachment_847\" align=\"aligncenter\" width=\"300\"]<a href=\"http://newdominions.com/wp-content/uploads/2014/08/IMG_2322.jpg\"><img class=\"size-medium wp-image-847\" src=\"http://newdominions.com/wp-content/uploads/2014/08/IMG_2322-300x225.jpg\" alt=\"Gabby, Stephen, and Graham relaxing during Rehearsal Week at Gabby\'s lake house. \" width=\"300\" height=\"225\" /></a> Gabby, Stephen, and Graham relaxing during Rehearsal Week at Gabby\'s lake house.[/caption]\r\n\r\n[/span4]\r\n\r\n[span4]\r\n[caption id=\"attachment_848\" align=\"aligncenter\" width=\"300\"]<a href=\"http://newdominions.com/wp-content/uploads/2014/08/IMG_2376.jpg\"><img src=\"http://newdominions.com/wp-content/uploads/2014/08/IMG_2376-300x225.jpg\" alt=\"The girls laughing at Smith Mountain Lake this summer\" width=\"300\" height=\"225\" class=\"size-medium wp-image-848\" /></a> The girls laughing at Smith Mountain Lake this summer[/caption]\r\n[/span4]\r\n\r\n[span4]\r\n[caption id=\"attachment_846\" align=\"aligncenter\" width=\"300\"]<a href=\"http://newdominions.com/wp-content/uploads/2014/08/IMG_2347.jpg\"><img src=\"http://newdominions.com/wp-content/uploads/2014/08/IMG_2347-300x225.jpg\" alt=\"NewDos performing one of our new songs in a quartet for the rest of group, a way we practiced blending during Rehearsal Week \" width=\"300\" height=\"225\" class=\"size-medium wp-image-846\" /></a> NewDos performing one of our new songs in a quartet for the rest of group, a way we practiced blending during Rehearsal Week [/caption]\r\n[/span4]\r\n [/columns]\r\n\r\n[columns] [span4]\r\n\r\n[caption id=\"attachment_571\" align=\"aligncenter\" width=\"300\"]<img class=\"wp-image-571 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/12/alchies-wine-tasting-300x199.jpg\" alt=\"alchies wine tasting\" width=\"300\" height=\"199\" /> NewDos in the beautiful Virginia hills[/caption]\r\n\r\n[/span4][span4]\r\n\r\n[caption id=\"attachment_574\" align=\"aligncenter\" width=\"300\"]<img class=\"wp-image-574 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/12/fall-roll-2014-300x215.jpg\" alt=\"fall roll 2014\" width=\"300\" height=\"215\" /> We need coffee in the morning[/caption]\r\n\r\n[/span4][span4]\r\n\r\n[caption id=\"attachment_572\" align=\"aligncenter\" width=\"300\"]<img class=\"wp-image-572 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/12/artsy-pic-300x200.jpg\" alt=\"artsy pic\" width=\"300\" height=\"200\" /> Artsy picture during the Fall Concert 2014[/caption]\r\n\r\n[/span4][/columns]\r\n\r\n[columns] [span8]\r\n\r\n[caption id=\"attachment_545\" align=\"aligncenter\" width=\"940\"]<img class=\"wp-image-545 size-large\" src=\"http://newdominions.com/wp-content/uploads/2014/08/IMG_5586-1024x518.jpg\" alt=\"IMG_5586\" width=\"940\" height=\"475\" /> Fourth year NewDos[/caption]\r\n\r\n[/span8][span4]\r\n\r\n[caption id=\"attachment_544\" align=\"aligncenter\" width=\"300\"]<img class=\"wp-image-544 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/08/IMG_5558-300x200.jpg\" alt=\"IMG_5558\" width=\"300\" height=\"200\" /> Busy rehearsing, obviously[/caption]\r\n\r\n[/span4][/columns]\r\n\r\n[columns] [span4]\r\n\r\n[caption id=\"attachment_559\" align=\"aligncenter\" width=\"300\"]<img class=\"wp-image-559 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/12/IMG_3627-300x225.jpg\" alt=\"IMG_3627\" width=\"300\" height=\"225\" /> Show us what you got![/caption]\r\n\r\n[/span4][span4]\r\n\r\n[caption id=\"attachment_558\" align=\"aligncenter\" width=\"300\"]<img class=\"wp-image-558 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/12/IMG_3625-300x225.jpg\" alt=\"IMG_3625\" width=