(651, 1, 0x323031352d30332d32302030383a35363a3238, 0x323031352d30332d32302031323a35363a3238, 'You can now buy tickets online! Although you\'ll be guided to PayPal\'s payment system, you don\'t necessarily need a PayPal account in order to buy online; just select the debit/credit card option instead. <em>Registration for the concert event closes at 12 PM (Noon) the day of the concert!</em>\r\n\r\nBe sure to show up 15 minutes before the concert to pick up your tickets from will call. You can also buy tickets from us directly on the lawn (or Newcomb Hall, if the weather warrants it), or at the door!\r\n\r\n[ESPRESSO_EVENTS]', 'Buy Tickets Online', '', 'inherit', 'closed', 'open', '', '349-revision-v1', '', '', 0x323031352d30332d32302030383a35363a3238, 0x323031352d30332d32302031323a35363a3238, '', 349, 'http://newdominions.com/349-revision-v1/', 0, 'revision', '', 0),
