(655, 1, 0x323031352d30342d30332031353a30333a3036, 0x323031352d30342d30332031393a30333a3036, '<span style=\"color: #000000;\">The New Dominions have </span>25 years of live performance experience, and we would love to sing at your next event! We are honored to have performed at a variety of events, including singing for the <a href=\"http://www.jeffersonscholars.org/\">UVa Jefferson Scholars Foundation</a>, at the <a href=\"https://www.facebook.com/VirginiaCavaliers/photos/a.10152715896082635.1073742149.73947377634/10152715977487635/?type=1&amp;permPage=1\">UVa vs. Duke basketball game</a>, and the <a href=\"http://virginiafilmfestival.org/\">Virginia Film Festival,</a> as well as weddings, retirement homes, birthday parties, and charity functions.\r\n\r\n&nbsp;\r\n\r\nWe are happy to cater our song set to meet your events unique needs. Reach out to us with details about your event, or any questions that you may have! Rates and availability may vary.\r\n\r\n&nbsp;\r\n\r\n<span style=\"color: #000000;\">We also look forward to hosting other groups during their tours, getting the opportunity to sing with them, and showing them the best of U.Va. D</span>rop us a note with any performance requests, questions, comments, or song suggestions. We\'d love to hear from you!\r\n\r\n<img class=\"alignleft size-large wp-image-654\" src=\"http://newdominions.com/wp-content/uploads/2014/06/10847575_10152715977487635_1640182007995211809_o-1024x640.jpg\" alt=\"Duke game\" width=\"960\" height=\"600\" />\r\n<p style=\"text-align: left;\"></p>', 'Contact Us', '', 'inherit', 'closed', 'open', '', '111-revision-v1', '', '', 0x323031352d30342d30332031353a30333a3036, 0x323031352d30342d30332031393a30333a3036, '', 111, 'http://newdominions.com/111-revision-v1/', 0, 'revision', '', 0),
(656, 1, 0x323031352d30342d30332031353a30333a3333, 0x323031352d30342d30332031393a30333a3333, '<span style=\"color: #000000;\">The New Dominions have </span>25 years of live performance experience, and we would love to sing at your next event! We are honored to have performed at a variety of events, including singing for the <a href=\"http://www.jeffersonscholars.org/\">UVa Jefferson Scholars Foundation</a>, at the <a href=\"https://www.facebook.com/VirginiaCavaliers/photos/a.10152715896082635.1073742149.73947377634/10152715977487635/?type=1&amp;permPage=1\">UVa vs. Duke basketball game</a>, and the <a href=\"http://virginiafilmfestival.org/\">Virginia Film Festival,</a> as well as weddings, retirement homes, birthday parties, and charity functions.\r\n\r\n\r\n\r\nWe are happy to cater our song set to meet your events unique needs. Reach out to us with details about your event, or any questions that you may have! Rates and availability may vary.\r\n\r\n\r\n\r\n<span style=\"color: #000000;\">We also look forward to hosting other groups during their tours, getting the opportunity to sing with them, and showing them the best of U.Va. D</span>rop us a note with any performance requests, questions, comments, or song suggestions. We\'d love to hear from you!\r\n\r\n<img class=\"alignleft size-large wp-image-654\" src=\"http://newdominions.com/wp-content/uploads/2014/06/10847575_10152715977487635_1640182007995211809_o-1024x640.jpg\" alt=\"Duke game\" width=\"960\" height=\"600\" />\r\n<p style=\"text-align: left;\"></p>', 'Contact Us', '', 'inherit', 'closed', 'open', '', '111-revision-v1', '', '', 0x323031352d30342d30332031353a30333a3333, 0x323031352d30342d30332031393a30333a3333, '', 111, 'http://newdominions.com/111-revision-v1/', 0, 'revision', '', 0),
