(659, 1, 0x323031352d30342d30332031353a31313a3530, 0x323031352d30342d30332031393a31313a3530, '<h2 style=\"text-align: center;\"><a href=\"http://newdominions.com/wp-content/uploads/2014/06/beach-week-2014.jpg\"><img class=\"aligncenter wp-image-108 size-large\" src=\"http://newdominions.com/wp-content/uploads/2014/06/beach-week-2014-1024x664.jpg\" alt=\"beach week 2014\" width=\"940\" height=\"609\" /></a></h2>\r\n<h2 style=\"text-align: center;\">Why should you be a Newdo?</h2>\r\nBecause we\'re a family. That sings.\r\n\r\nSeriously though. We hope that you find us to be the perfect match for you. We think our connection with our alumni, our diverse repertoire and overall fun personality make us unique.Newdos are the University of Virginia\'s oldest co-ed a cappella group, with a rich history of 25 years. Over this time, we\'ve evolved into a very big, involved family. Our alumni (\'crusties\') are always looking to hang out, and wherever you go in life, the Newdos will support you through thick and thin. The Newdos also perform a wide variety of music, from Fleet Foxes to Delta Rae. As a Newdo, you\'ll get to travel with us all around the country to meet and perform with other a cappella groups. The Newdos are always up to fun shenanigans, so you can bet there won\'t be a dull moment in your time with us. <em>Feel free to <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">contact us</a> if you have any more questions!</em>\r\n<h2 style=\"text-align: center;\">So you want to be a Newdo?</h2>\r\nAuditions will be held the first week of classes in the fall semester! Look out for specifics on our <a title=\"Events and Tickets\" href=\"http://newdominions.com/events-and-gallery/events-and-tickets/\">Events</a> page. We\'re always looking to get new members. You have to be a male or female student at the University of Virginia to audition. And don\'t worry - you don\'t have to have an extensive musical background to fit in. Newdos have ranged anywhere from shower-only singers to operatic geniuses.\r\n<h2 style=\"text-align: center;\">How do auditions work?</h2>\r\nThere are four simple steps:\r\n<ul>\r\n	<li>First, get to know us. Come out to Rotunda Sing and connect with us on <strong><a href=\"https://www.facebook.com/newdominions\">Facebook</a>, <a href=\"https://twitter.com/NewDominions\">Twitter</a> or <a href=\"https://instagram.com/newdominions/\">Instagram</a></strong>! Meet the group at the Student Activities Fair, where we will answer all your questions and you will get a feel for the group.</li>\r\n	<li>Second, sign up for an audition slot (find details on our Facebook page); we also do walk-ins, but wait times can be long. <strong>Come early to fill out an info sheet</strong>, and youre set!</li>\r\n	<li>Third, the audition. Well start with warm-ups to understand your range. Come prepared with a <strong>verse and chorus of a popular song</strong> to sing for your solo (no Disney, Broadway, or rap pretty please!). We may also ask you to do other musical exercises.</li>\r\n	<li>Lastly, at the end of auditions, <strong>we post a callback list on the audition room</strong>. We will contact those invited to a callback with more details!</li>\r\n</ul>\r\n<h2 style=\"text-align: center;\">What is the time commitment?</h2>\r\n<span style=\"color: #000000;\">Like any a cappella group on Grounds, the New Dominions is a pretty big time commitment. We rehearse twice a week for 3 hoursat a time. We also have frequent gigs both on- and off-Grounds. It is definitely possible to be in involved in other organizations on Grounds  we all are  but Newdos must be a priority.</span>\r\n<h2 style=\"text-align: center;\">More questions?</h2>\r\nShoot us a message on the <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">Contact page</a> and we\'ll be happy to answer you in detail!\r\n\r\n&nbsp;', 'Auditions', '', 'inherit', 'closed', 'open', '', '103-revision-v1', '', '', 0x323031352d30342d30332031353a31313a3530, 0x323031352d30342d30332031393a31313a3530, '', 103, 'http://newdominions.com/103-revision-v1/', 0, 'revision', '', 0),
(660, 1, 0x323031352d30342d30332031353a31373a3133, 0x323031352d30342d30332031393a31373a3133, 'We\'ve been making music for over 20 years. All proceeds from sales go directly to helping us produce more CDs so we can keep making music, so head on over to the <a href=\"https://itunes.apple.com/us/artist/new-dominions/id287225725?uo=4\" target=\"itunes_store\">New Dominions</a> iTunes page to purchase our CDs! Our newest albums are also available on<a href=\"http://https://loudr.fm/artist/the-new-dominions/d6z5Z\"> Loudr.FM </a>for online download. If you would like to make an additional donation or purchase our older CDs, please <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">contact us</a>! We will be forever grateful.\r\n\r\nThis year,\r\n\r\n[playlist ids=\"637,638,639,640,641,642,643,644,645,646,647,648\"]\r\n\r\nClick on the images to find the track listing for the CDs!\r\n\r\n[columns] [span3]\r\n\r\n<a href=\"http://newdominions.com/music/boxed-or-hung-1998/\"><img class=\"aligncenter wp-image-78 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/boxed_or_hung-150x150.jpg\" alt=\"boxed_or_hung\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Boxed or Hung (1998)</p>\r\n[/span3][span3]\r\n<p style=\"text-align: center;\"><a href=\"http://newdominions.com/music/whatthehellhappened-2000/\"><img class=\"alignnone wp-image-75 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/whatthehellhappened-150x150.jpg\" alt=\"whatthehellhappened\" width=\"150\" height=\"150\" /></a></p>\r\n<p style=\"text-align: center;\">Whatthehellhappened? (2000)</p>\r\n[/span3][span3]\r\n\r\n<a href=\"http://newdominions.com/music/live-and-let-da-2002/\"><img class=\"aligncenter wp-image-72 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/live_and_let_da-150x150.jpg\" alt=\"live_and_let_da\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Live and Let 