.com/music/boxer-breakfast-2011/\"><img class=\"aligncenter wp-image-50 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/06/boxer_breakfast-150x150.jpg\" alt=\"boxer_breakfast\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Boxer Breakfast (2011)</p>\r\n[/span3][span3]\r\n\r\n<a href=\"http://newdominions.com/music/porch-time-2013/\"><img class=\"aligncenter wp-image-46 size-thumbnail\" src=\"http://newdominions.com/wp-content/uploads/2014/05/porch-time-150x150.jpg\" alt=\"porch time\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">Porch Time (2013)</p>\r\n[/span3][span3]\r\n\r\n<a href=\"http://newdominions.com/music/23-degrees-2014/\"><img class=\"aligncenter wp-image-475\" src=\"http://newdominions.com/wp-content/uploads/2014/11/23-degrees-final-200x200.jpg\" alt=\"23 degrees final\" width=\"150\" height=\"150\" /></a>\r\n<p style=\"text-align: center;\">23 Degrees (2014)</p>\r\n[/span3][span3]\r\n\r\n[/span3][/columns]', 'Music', '', 'inherit', 'closed', 'open', '', '267-revision-v1', '', '', 0x323031352d30342d30332031353a31393a3136, 0x323031352d30342d30332031393a31393a3136, '', 267, 'http://newdominions.com/267-revision-v1/', 0, 'revision', '', 0),
(663, 1, 0x323031352d30342d32312031313a30303a3133, 0x323031352d30342d32312031353a30303a3133, '', 'NewDos Auditions', '', 'inherit', 'closed', 'open', '', 'newdos-auditions', '', '', 0x323031352d30342d32312031313a30303a3133, 0x323031352d30342d32312031353a30303a3133, '', 103, 'http://newdominions.com/wp-content/uploads/2014/06/NewDos-Auditions.mp4', 0, 'attachment', 'video/mp4', 0),
(665, 1, 0x323031352d30342d32312031313a30393a3334, 0x323031352d30342d32312031353a30393a3334, '<h2 style=\"text-align: center;\"></h2>\r\n[video width=\"1280\" height=\"720\" mp4=\"http://newdominions.com/wp-content/uploads/2014/06/NewDos-Auditions.mp4\"][/video]\r\n<h2 style=\"text-align: center;\">Why should you be a Newdo?</h2>\r\nBecause we\'re a family. That sings.\r\n\r\nSeriously though. We hope that you find us to be the perfect match for you. We think our connection with our alumni, our diverse repertoire and overall fun personality make us unique.Newdos are the University of Virginia\'s oldest co-ed a cappella group, with a rich history of 25 years. Over this time, we\'ve evolved into a very big, involved family. Our alumni (\'crusties\') are always looking to hang out, and wherever you go in life, the Newdos will support you through thick and thin. The Newdos also perform a wide variety of music, from Marvin Gaye, to Fleet Foxes to Neon Trees. As a Newdo, you\'ll get to travel with us all around the country to meet and perform with other a cappella groups. The Newdos are always up to fun shenanigans, so you can bet there won\'t be a dull moment in your time with us. <strong><em>Feel free to <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">contact us</a> if you have any more questions!</em></strong>\r\n<h2 style=\"text-align: center;\">So you want to be a Newdo?</h2>\r\nAuditions will be held the first week of classes in the fall semester! Look out for specifics on our <a title=\"Events and Tickets\" href=\"http://newdominions.com/events-and-gallery/events-and-tickets/\">Events</a> page. We\'re always looking to get new members. You have to be a male or female student at the University of Virginia to audition. And don\'t worry - you don\'t have to have an extensive musical background to fit in. Newdos have ranged anywhere from shower-only singers to operatic geniuses.\r\n<h2 style=\"text-align: center;\">How do auditions work?</h2>\r\nThere are four simple steps:\r\n<ul>\r\n	<li>First, get to know us. Come out to Rotunda Sing and connect with us on <strong><a href=\"https://www.facebook.com/newdominions\">Facebook</a>, <a href=\"https://twitter.com/NewDominions\">Twitter</a> or <a href=\"https://instagram.com/newdominions/\">Instagram</a></strong>! Meet the group at the Student Activities Fair, where we will answer all your questions and you will get a feel for the group.</li>\r\n	<li>Second, sign up for an audition slot (find details on our Facebook page); we also do walk-ins, but wait times can be long. <strong>Come early to fill out an info sheet</strong>, and youre set!</li>\r\n	<li>Third, the audition. Well start with warm-ups to understand your range. Come prepared with a <strong>verse and chorus of a popular song</strong> to sing for your solo (no Disney, Broadway, or rap pretty please!). We may also ask you to do other musical exercises.</li>\r\n	<li>Lastly, at the end of auditions, <strong>we post a callback list on the audition room</strong>. We will contact those invited to a callback with more details!</li>\r\n</ul>\r\n<h2 style=\"text-align: center;\">What is the time commitment?</h2>\r\n<span style=\"color: #000000;\">Like any a cappella group on Grounds, the New Dominions is a pretty big time commitment. We rehearse twice a week for 3 hoursat a time. We also have frequent gigs both on- and off-Grounds. It is definitely possible to be in involved in other organizations on Grounds  we all are  but Newdos must be a priority.</span>\r\n<h2 style=\"text-align: center;\">More questions?</h2>\r\nShoot us a message on the <a title=\"Contact Us\" href=\"http://newdominions.com/contact-us/\">Contact page</a> and we\'ll be happy to answer you in detail!\r\n\r\n&nbsp;', 'Auditions', '', 'inherit', 'closed', 'open', '', '103-revision-v1', '', '', 0x323031352d30342d32312031313a30393a3334, 0x323031352d30342d32312031353a30393a3334, '', 103, 'http://newdominions.com/103-revision-v1/', 0, 'revision', '', 0),
