(710, 1, 0x323031352d30382d32322031383a34343a3232, 0x323031352d30382d32322032323a34343a3232, '<p style=\"color: #000000; text-align: left;\">The New Dominions is the University of Virginia\'s oldest co-ed<em>a cappella</em>group and we have 25 years worth of history. The completely student-run group dedicates itself to bringing a dynamic edge to the University\'s proudest traditions, growing in strength and ability over the last twenty five years and performing at events and concerts across the country. The New Dominions is guaranteed to please any crowd with its varied repertoire including music of all genres, from Sara Bareillesto Radiohead, and from Frankie Valli to Billy Joel. Be sure to check out the <a title=\"Music\" href=\"http://newdominions.com/music/\">Music</a>page!</p>\r\n<p style=\"color: #000000;\">Often referred to by students as the \"NewDos,\" the group was was founded in 1990 by Burt Kann, Stephen Murray and Joanna Parsons, students at the University of Virginia. The group initially served as a temporary way to teach first years the basics of a cappella so they could audition for existing groups around Grounds. Once the NewDos came to their senses and realized what a terrible idea this was, they chose to stick together and have been exploding heads with awesomeness ever since. Today, the Newdos has become the University\'s premier co-ed a cappella group and holds auditions every Fall and some Spring semesters that are open to all interested U.Va. students.</p>\r\n[columns] [span4]\r\n\r\n<img class=\"alignleft size-medium wp-image-302\" src=\"http://newdominions.com/wp-content/uploads/2014/06/26886_934106051833_2252827_n-300x200.jpg\" alt=\"26886_934106051833_2252827_n\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][span4]\r\n\r\n<img class=\"aligncenter size-medium wp-image-303\" src=\"http://newdominions.com/wp-content/uploads/2014/06/577319_10150712262659613_631252736_n-300x200.jpg\" alt=\"577319_10150712262659613_631252736_n\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][span4]\r\n\r\n<img class=\"alignright size-medium wp-image-301\" src=\"http://newdominions.com/wp-content/uploads/2014/06/26886_933626437983_256510_n-300x200.jpg\" alt=\"26886_933626437983_256510_n\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][/columns]\r\n<p style=\"color: #000000;\"></p>', 'History', '', 'inherit', 'closed', 'open', '', '100-revision-v1', '', '', 0x323031352d30382d32322031383a34343a3232, 0x323031352d30382d32322032323a34343a3232, '', 100, 'http://newdominions.com/100-revision-v1/', 0, 'revision', '', 0),
