(853, 2, 0x323031362d30382d32332031343a31373a3331, 0x323031362d30382d32332031383a31373a3331, 'We had so much fun making awesome music during our concert last spring! Here are some photos. Check out our <a href=\"https://www.youtube.com/user/NewDominions\">YouTube page</a>for videos from the concert.\r\n\r\n[columns][span4]\r\n\r\n[caption id=\"attachment_877\" align=\"aligncenter\" width=\"800\"]<a href=\"http://newdominions.com/wp-content/uploads/2016/08/12976708_10154077650084844_609131388055069504_o.jpg\"><img src=\"http://newdominions.com/wp-content/uploads/2016/08/12976708_10154077650084844_609131388055069504_o-300x200.jpg\" alt=\"Hayley and Kerry duet during their rousing rendition of &quot;Dynasty&quot; by MIIA\" width=\"300\" height=\"200\" class=\"size-medium wp-image-877\" /></a> Hayley and Kerry duet during their rousing rendition of \"Dynasty\" by MIIA[/caption]\r\n\r\n[/span4][span4]\r\n\r\n[caption id=\"attachment_866\" align=\"aligncenter\" width=\"300\"]<a href=\"http://newdominions.com/wp-content/uploads/2016/08/12977235_10209045175389184_4244427682126708151_o.jpg\"> <img class=\"size-medium wp-image-866\" src=\"http://newdominions.com/wp-content/uploads/2016/08/12977235_10209045175389184_4244427682126708151_o-300x225.jpg\" alt=\"The first years joking around before their last concert as Newbies!\" width=\"300\" height=\"200\" /></a> The first years joking around before their last concert as Newbies![/caption]\r\n\r\n\r\n[/span4][span4]\r\n\r\n[caption id=\"attachment_878\" align=\"aligncenter\" width=\"300\"]<a href=\"http://newdominions.com/wp-content/uploads/2016/08/12976869_10154077655984844_1011959480030424949_o.jpg\"><img src=\"http://newdominions.com/wp-content/uploads/2016/08/12976869_10154077655984844_1011959480030424949_o-300x200.jpg\" alt=\"Sean and Blake hug after Sean delivers Blake&#039;s senior speech, before Blake&#039;s senior solo\" width=\"300\" height=\"200\" class=\"size-medium wp-image-878\" /></a> Sean and Blake hug after Sean delivers Blake\'s senior speech, before Blake\'s senior solo[/caption]\r\n\r\n[/span4][/columns]\r\n\r\n[columns][span4]\r\n[caption id=\"attachment_887\" align=\"aligncenter\" width=\"300\"]<a href=\"http://newdominions.com/wp-content/uploads/2016/08/13002392_10154077655844844_9150052449431427345_o.jpg\"><img src=\"http://newdominions.com/wp-content/uploads/2016/08/13002392_10154077655844844_9150052449431427345_o-300x200.jpg\" alt=\"Caroline and Allison laugh during one of the senior speeches!\" width=\"300\" height=\"200\" class=\"size-medium wp-image-887\" /></a> Caroline and Allison laugh during one of the senior speeches![/caption]\r\n[/span4][span4]\r\n\r\n[caption id=\"attachment_885\" align=\"aligncenter\" width=\"300\"]<a href=\"http://newdominions.com/wp-content/uploads/2016/08/12973296_10154077651804844_318532727612642866_o.jpg\"><img src=\"http://newdominions.com/wp-content/uploads/2016/08/12973296_10154077651804844_318532727612642866_o-300x200.jpg\" alt=\"Hannah, Nick, and Shayaan harmonize during &quot;Temporary Fix&quot; by One Direction\" width=\"300\" height=\"200\" class=\"size-medium wp-image-885\" /></a> Hannah, Nick, and Shayaan harmonize during \"Temporary Fix\" by One Direction[/caption]\r\n[/span4][span4]\r\n\r\n[caption id=\"attachment_880\" align=\"aligncenter\" width=\"300\"]<a href=\"http://newdominions.com/wp-content/uploads/2016/08/12977078_10154077653394844_1823979200587160276_o.jpg\"><img src=\"http://newdominions.com/wp-content/uploads/2016/08/12977078_10154077653394844_1823979200587160276_o-300x200.jpg\" alt=\"The newbies perform a CD skit advertising our newly-released album, &quot;No Context&quot;\" width=\"300\" height=\"200\" class=\"size-medium wp-image-880\" /></a> The newbies perform a CD skit advertising our newly-released album, \"No Context\"[/caption]\r\n[/span4][/columns]\r\n[columns][span6]\r\n\r\n[caption id=\"attachment_875\" align=\"aligncenter\" width=\"200\"]<a href=\"http://newdominions.com/wp-content/uploads/201