(1031, 1, 0x323031372d30382d32302031393a33353a3133, 0x323031372d30382d32302032333a33353a3133, '<p style=\"color: #000000; text-align: left;\">The New Dominions is the University of Virginia\'s oldest co-ed<em>a cappella</em>group and we have 27 years worth of history. The completely student-run group dedicates itself to bringing a dynamic edge to the University\'s proudest traditions, growing in strength and ability over the last twenty-seven years and performing at events and concerts across the country. The New Dominions is guaranteed to please any crowd with its varied repertoire including music of all genres, from Michael Jackson to Radiohead, and from the Civil Wars to Ariana Grande. Be sure to check out the <a title=\"Music\" href=\"http://newdominions.com/music/\">Music</a>page!</p>\r\n<p style=\"color: #000000;\">Often referred to by students as the \"NewDos,\" the group was was founded in 1990 by Burt Kann, Stephen Murray and Joanna Parsons, students at the University of Virginia. The group initially served as a temporary way to teach first years the basics of a cappella so they could audition for existing groups around Grounds. Soon, the NewDos came to their senses, realized what a terrible idea this was. We chose to stick together and have been recording albums, touring the nation, and kicking ass ever since. Today, the Newdos have become the University\'s premier co-ed a cappella group. Auditions are held every Fall and some Spring semesters and are open to all interested UVa students. Follow us on our <a href=\"www.facebook.com/newdominions\">Facebook </a>and <a href=\"https://twitter.com/newdominions\">Twitter </a>pages to keep up with us.</p>\r\n[columns] [span4]\r\n\r\n<img class=\"alignleft wp-image-302 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/06/26886_934106051833_2252827_n-300x200.jpg\" alt=\"20th anniversary history\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][span4]\r\n\r\n<img class=\"aligncenter wp-image-303 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/06/577319_10150712262659613_631252736_n-300x200.jpg\" alt=\"NewDo history\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][span4]\r\n\r\n<img class=\"alignright wp-image-301 size-medium\" src=\"http://newdominions.com/wp-content/uploads/2014/06/26886_933626437983_256510_n-300x200.jpg\" alt=\"NewDo 20th history\" width=\"300\" height=\"200\" />\r\n\r\n[/span4][/columns]\r\n<p style=\"color: #000000;\"></p>', 'History', '', 'inherit', 'closed', 'closed', '', '100-revision-v1', '', '', 0x323031372d30382d32302031393a33353a3133, 0x323031372d30382d32302032333a33353a3133, '', 100, 'http://newdominions.com/100-revision-v1/', 0, 'revision', '', 0),
